export class ToDoEntry {
  static counter: number = 1;
  id: number;
  vorname: string;
  nachname: string;
  beschreibung: string;
  done: boolean;
  date: Date;

  constructor(title: string) {
    this.id = ToDoEntry.counter++;
    this.title = title;
    this.done = false;
    this.date = new Date();
  }

  changeStatus(value: boolean) {
    this.done = value;
  }
}
